import { Link as ChakraNavLink } from '@chakra-ui/core';
import NextLink from 'next/link';

const NavLink = ({ ...props }) => (
  <NextLink {...props} passHref>
    <ChakraNavLink as='a'>{children}</ChakraNavLink>
  </NextLink>
);

export default NavLink;
